/* 목록으로 돌아가기 */
function showList() {
	$(".room-list button").remove();
	$(".room-detail-heading").remove();
	$(".room-basic-info-all").remove();
	$(".room-basic-info-1").remove();
	$(".room-basic-info-2").remove();
	$(".room-basic-info-3").remove();
	$(".room-building-info-all").remove();
	$(".room-option-info").remove();
	$(".room-cost-include").remove();
	$(".room-transportation-info").remove();
	$(".room-explanation-info").remove();
	$(".room-building").remove();
	$(".office-info").remove();
	$(".room-building-info-table").remove();
	$(".title").remove();
	$(".divider-line").remove();
	$(".title-end").remove();
	$("hr:not(hr:first-of-type)").remove();

	/* 매물 목록 다시 표시 */
	$(".room-list h4").css('display', 'block');
	$(".room-list hr").css('display', 'block');
	$(".room-list ul").css('display', 'block');
}

