function wishList(){

		let heartColor = $(".glyphicon-heart").css('color');

		if(heartColor == 'rgb(196, 196, 196)') {
			$(".glyphicon-heart").css('color', '#ff5959');

		} else {
			$(".glyphicon-heart").css('color', '#c4c4c4');
		}
}


